import React,{FC} from 'react';
import {IUser} from "../../types/types";
import './UserItem.css';

interface UserItemProps {
    user:IUser;
}


const UserItem:FC<UserItemProps> = ({user}) => {
    return (
        <div className="users-list">
            {user.id}. {user.name} Телефон: {user.phone}
            
        </div>
    );
};

export default UserItem;
